import React from "react";
import { Table } from "react-bootstrap";

const ControlComponentDataTable = (props) => {
  let propsData = props;
  return (
    <div>
      <Table striped bordered hover>
        <thead>
          <tr >
            <th>Id</th>
            <th>Name</th>
            <th>Password</th>
            <th>Phone</th>
            <th>Message</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {propsData.userData.length >= 1 ? (
           propsData.userData.map((obj, i) => {
            return (
                <tr>
                <td>1</td>
                <td>Mark</td>
                <td>424r43ff43</td>
                <td>6290468136</td>
                <td>Hello</td>
                <td>
                  <button>Delete</button>
                  <button>Edit</button>
                </td>
              </tr>
            )
           })
          ) : (
            <tr>
              <td colSpan={6}>No Data Found</td>
            </tr>
          )}
        </tbody>
      </Table>
    </div>
  );
};

export default ControlComponentDataTable;
